import React, {useState} from 'react';

import AddUser from './Components/Users/AddUser';
import UserList from './Components/Users/UserList';


function App() {

  const [userInfo, setUserInfo] = useState([])

  function userInformationHandler(enteredInformation){
    setUserInfo(previousInfo => [enteredInformation, ...previousInfo])
  }

  let ListPlaceholder = <p> No users input!</p>

  if(userInfo !== []){
  ListPlaceholder = <UserList users={userInfo}/>
  }
  return (
    <div>
      <AddUser onAdd ={userInformationHandler}/>
      {ListPlaceholder}
    </div>
  );
}

export default App;
